(window.webpackJsonp=window.webpackJsonp||[]).push([[44],{399:function(n,h,t){"use strict";t.r(h);var i=t(44),g=Object(i.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1016-truong-huyen-pha-phong-an-thuong"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1016-truong-huyen-pha-phong-an-thuong"}},[n._v("#")]),n._v(" Chương 1016: Trương Huyền phá phong ấn (thượng)")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("br"),t("br"),n._v("Chỉ cần trận pháp vận chuyển, Thiên Đạo thư viện đều có thể tìm tới thiếu hụt, so cái gì la bàn loại hình chuẩn xác hơn nhiều."),t("br"),t("br"),n._v("Người khác tìm không thấy cái này vị trí chính xác, không biết thi triển bao lớn, mạnh cỡ nào lực lượng, nhưng đối với hắn mà nói, ngược lại là đơn giản nhất."),t("br"),t("br"),n._v("“Thử xem?”"),t("br"),t("br"),n._v("Ngô sư lắc đầu: “Ta biết Trương viện trưởng, tại trên trận pháp rất có trình độ, có thể cái này dính dáng thực sự quá lớn, chỉ có thể thành công không thể thất bại, tuyệt đối không thể lấy loạn thử...”"),t("br"),t("br"),n._v("Một khi thất bại, liền sẽ nổ tung, tất cả mọi người sẽ bị nổ chết... Không phải trò đùa, không phải có thể thử đồ chơi."),t("br"),t("br"),n._v("“Ta biết...”"),t("br"),t("br"),n._v("Trương Huyền gật đầu, đang muốn nói chuyện, liền nghe đến trên không một thanh âm vang lên: “Thử xem? Xảy ra chuyện, ngươi gồng gánh nổi ư? Tuổi còn trẻ, liền miệng lưỡi lưu loát, còn thể thống gì?”"),t("br"),t("br"),n._v("Ầm ầm!"),t("br"),t("br"),n._v("Một cái lão giả bay đến mọi người trước mặt, rơi xuống, chính là trước đó trên không trung chủ trì gia cố phong ấn thất tinh đỉnh phong trận pháp sư, Hàn Tự!"),t("br"),t("br"),n._v("Hắn lúc này, mặc dù mặt mũi mệt mỏi, nhưng nhìn về phía Trương Huyền, mang theo lạnh lùng cùng không vui."),t("br"),t("br"),n._v("“Hàn hội trưởng... Ta tới cấp cho ngươi giới thiệu một chút!”"),t("br"),t("br"),n._v("Ngô sư vội vàng hóa giải xấu hổ: “Vị này là Hồng Viễn danh sư học viện tân nhiệm viện trưởng, Trương Huyền Trương sư, vị kia là Lạc sư! Ngô sư, cũng không cần giới thiệu, tất cả mọi người là lão bằng hữu. Trương viện trưởng, Lạc sư, vị này là chúng ta Thanh Nguyên đế quốc trận pháp sư công hội hội trưởng, Hàn Tự!”"),t("br"),t("br"),n._v("“Ngươi chính là Trương Huyền?”"),t("br"),t("br"),n._v("Nghe xong giới thiệu, Hàn Tự nhìn lại: “Ta nghe nói qua ngươi, tại trên trận pháp rất có thành tựu, trẻ tuổi như vậy, liền có thể lĩnh ngộ cấp sáu trận pháp chân lý, xem như thiên tài hiếm thấy. Bất quá... Thân là danh sư, muốn nói cẩn thận, lời nói cẩn thận, nghĩ lại mà làm sau. Người người đều biết lấp không bằng khai thông, nhưng ngươi có thể biết, một khi thất bại, sẽ mang đến dạng gì kết quả? Không riêng gì chúng ta đều sẽ chết, phạm vi một ngàn cây số phạm vi bên trong, đều đem chịu đến cực lớn tiến công, vô số sinh mệnh biến mất... Loại trách nhiệm này, ngươi gánh chịu được tốt hay sao hả?”"),t("br"),t("br"),n._v("“Hàn hội trưởng, hiểu lầm, ta nói thử xem, tự nhiên là có nắm chắc lại nói, dính dáng nhiều người như vậy tính mạng, không dám làm loạn!”"),t("br"),t("br"),n._v("Biết đối phương cũng không phải là có ý định làm khó, mà là lòng trách nhiệm gây ra, Trương Huyền cũng không tức giận, cười cười giải thích."),t("br"),t("br"),n._v("“Khẩu khí thật lớn!”"),t("br"),t("br"),n._v("Lại một vị trung niên đi tới, trên mặt lộ ra vẻ châm chọc: “Trước mắt cái này phong ấn, có thể là cấp tám trận pháp, thậm chí cao hơn, ta cùng lão sư, suy tính hai ngày hai đêm, đều không có tìm tới có thể phóng thích lực lượng, mà không thương tổn đến người tiết điểm, ngươi mới đi đến, trận pháp đều không có nhìn, liền trực tiếp tới câu có nắm chắc... Đường đường danh sư học viện viện trưởng, có phần quá mức ngông cuồng đi!”"),t("br"),t("br"),n._v("Người trung niên này, lực lượng hùng hậu, từ xa nhìn lại, cho người ta một loại trên tinh thần áp bức."),t("br"),t("br"),n._v("Thánh vực tam trọng, Thai Anh cảnh!"),t("br"),t("br"),n._v("Thai Anh cảnh cũng kêu Nguyên Anh cảnh, nguyên thai lột xác hình người, hướng Nguyên Thần cảnh bước ra một bước dài, loại thực lực này người, linh hồn mạnh mẽ vô cùng, chỉ cần tu vi không có đạt tới, hoàn toàn có thể nhẹ nhõm nghiền ép."),t("br"),t("br"),n._v("“Khụ khụ, Trương sư, vị này là... Hàn hội trưởng học sinh, Thất Tinh trận pháp đại tông sư, Lưu Mặc!” Không nghĩ tới Trương sư một câu, liền huyên náo như thế cương, Ngô sư tràn đầy xấu hổ."),t("br"),t("br"),n._v("Hai ngày này, Hàn hội trưởng cùng học sinh của hắn, vì tìm kiếm cái này có thể phóng thích lực lượng tiết điểm, hao tốn vô số tâm huyết, ròng rã hai ngày hai đêm đều không có chợp mắt, đáng tiếc vẫn như cũ không cách nào xác nhận."),t("br"),t("br"),n._v("Nghe được cái tên này vừa tới đến, liền nói khoác không biết ngượng nói thử xem... Lập tức tất cả đều nổi giận."),t("br"),t("br"),n._v("“Lưu Mặc?” Trương Huyền lắc đầu: “Thật có lỗi, chưa từng nghe qua...”"),t("br"),t("br"),n._v("Thanh Nguyên đế quốc, hắn đi đều không có đi qua, trận pháp gì sư, cái gì hội trưởng, một cái đều không có nghe qua, vốn là tính toán không biết, cũng sẽ không nói đi ra, nhưng đối phương bộ dáng này, chẳng muốn tiếp tục giả vờ người tốt."),t("br"),t("br"),n._v("“Ngươi...”"),t("br"),t("br"),n._v("Không nghĩ tới cái tên này, thời gian nháy mắt liền oán giận tới, mặc dù tức giận, Lưu Mặc vẫn là hất lên ống tay áo: “Nghe chưa từng nghe qua ta không có vấn đề, ta tại Thanh Nguyên đế quốc trận pháp công hội, vốn là cái vô danh tiểu tốt.”"),t("br"),t("br"),n._v("“Ngươi hiểu lầm, ta không phải nói chưa từng nghe qua tên của ngươi!”"),t("br"),t("br"),n._v("Lắc đầu, Trương Huyền một mặt thành khẩn nhìn qua: “Mà là liền Hàn hội trưởng cũng chưa nghe nói qua!”"),t("br"),t("br"),n._v("“Ngươi...”"),t("br"),t("br"),n._v("Suýt chút nữa tức điên, Lưu Mặc vẻ mặt tăng thấu đỏ, Hàn hội trưởng cũng thiếu chút không có tức giận thổ huyết."),t("br"),t("br"),n._v("Hắn Hàn Tự mặc dù không nói danh chấn Thanh Nguyên đế quốc, nhưng cũng nổi danh mấy trăm năm, hàng năm đều có vô số phụ tu trận pháp danh sư, hy vọng có thể bái nhập môn hạ của hắn, cái tên này ngược lại tốt, nói mình học sinh, liền hắn cũng tiện thể lên..."),t("br"),t("br"),n._v("Nhưng lại xảy ra khí không được, buồn bực có chút phát điên."),t("br"),t("br"),n._v("Nghe được hai người đối thoại, một bên Lạc Nhược Hi nhẹ nhàng cười một tiếng."),t("br"),t("br"),n._v("Cùng cái tên này chơi oán giận người... Oán giận không chết ngươi!"),t("br"),t("br"),n._v("Cái tên này vốn là cái không coi trọng quy củ, ưa thích làm loạn người."),t("br"),t("br"),n._v("Liền Khổng sư cũng dám oán giận... Ngươi là cái thá gì ah!"),t("br"),t("br"),n._v("“Được rồi, chưa từng nghe qua cũng không cần kích động như vậy, ta đường đường danh sư học viện viện trưởng, rất bận rộn, không có khả năng người nào đều muốn biết!”"),t("br"),t("br"),n._v(" Khoát tay áo, Trương Huyền hai tay chắp sau lưng, đi về phía trước một bước, nhìn về phía trước mắt cực lớn cái hố, ánh mắt mang theo thâm thúy: “Ngô sư, chuẩn bị cho ta một cái trận kỳ, tốt nhất đạt tới cấp bảy đỉnh phong cấp bậc!”"),t("br"),t("br"),n._v("“Cái này...”"),t("br"),t("br"),n._v("Ngô sư trên mặt làm khó."),t("br"),t("br"),n._v("“Dừng tay! Ngươi thật chẳng lẽ muốn cho nhiều người như vậy cho ngươi chôn cùng?” Thấy hắn muốn tìm thất tinh đỉnh phong cấp bậc trận kỳ, rõ ràng là muốn thí nghiệm tiết điểm, Lưu Mặc lông tơ nổ lên, bỗng nhiên đi tới trước mặt."),t("br"),t("br"),n._v("Cái tên này đến cùng có biết hay không nguy hiểm?"),t("br"),t("br"),n._v("Hắn cùng lão sư nghiên cứu hai ngày hai đêm, cũng không dám xác định, không muốn thử nghiệm, hắn ngược lại tốt, mới đi đến chừng mười phút đồng hồ liền muốn tiến lên... Phía dưới này nhưng có hơn hai vạn danh sư, ngươi không muốn sống nữa, chẳng lẽ những người khác cũng không quan tâm?"),t("br"),t("br"),n._v("Bọn họ gặp qua không ít viện trưởng, đều lấy học sinh làm trọng, cái tên này ngược lại tốt, quả thực chính là người điên... Còn không có hiểu rõ rồi xoay người về phía trước, Hồng Viễn học viện làm sao tuyển ra như vậy một cái hai hàng?"),t("br"),t("br"),n._v("“Chôn cùng, ngươi suy nghĩ nhiều... Các ngươi hai ngày hai đêm cũng không tìm tới tiết điểm, không phải công lao, mà là đần! Ta đương nhiên sẽ không giống như các ngươi!”"),t("br"),n._v(" Lắc đầu, Trương Huyền không tiếp tục để ý đối phương, mấy bước đi tới cái hố trước mặt."),t("br"),t("br"),n._v("“Viện trưởng...”"),t("br"),t("br"),n._v("Nhìn thấy hắn đi tới, canh giữ tại cái hố trước mặt rất nhiều học sinh nhao nhao đứng dậy, nguyên một đám tràn đầy tôn sùng."),t("br"),t("br"),n._v("“Ừm, mọi người vất vả!”"),t("br"),t("br"),n._v("Trương Huyền gật đầu."),t("br"),t("br"),n._v("“Vì nhân tộc phục vụ...”"),t("br"),t("br"),n._v("Mọi người đồng thời gật đầu."),t("br"),t("br"),n._v("“Lão sư... Không thể để cho cái tên này quấy rối!” Thấy hắn đi tới phong ấn trước mặt, Lưu Mặc một mặt cuống cuồng, nhịn không được nhìn về phía cách đó không xa lão sư."),t("br"),t("br"),n._v("“Yên tâm đi, tiết điểm không có dễ dàng như vậy tìm, chúng ta tiêu tốn như thế lớn công phu, nghiên cứu hai ngày hai đêm, đều chỉ suy đoán ra năm nơi khả nghi, hắn vừa tới đến, làm sao có thể tìm tới?”"),t("br"),t("br"),n._v("Hàn hội trưởng lắc đầu, đối Trương Huyền có thể tìm tới tiết điểm, căn bản cũng không tin tưởng."),t("br"),t("br"),n._v("Cũng khó trách, hắn thân là thất tinh đỉnh phong trận pháp sư, vì áp chế xuống phương đột nhiên nổi lên cuồng bạo lực lượng, nghiên cứu thời gian dài như vậy, đều không có mặt mày, một cái lục tinh trận pháp sư, làm sao có thể liếc mắt liền phát hiện vấn đề?"),t("br"),t("br"),n._v("“Thế nhưng là... Ta sợ hắn cái gì cũng đều không hiểu, liền lỗ mãng thí nghiệm, một khi tính sai, rất dễ dàng đưa tới tai họa lớn...”"),t("br"),t("br"),n._v("Lưu Mặc vội nói."),t("br"),t("br"),n._v("“Không cần phải gấp, tìm kiếm tiết điểm cần thời gian, tìm tới tiết điểm, như muốn bên trong lực lượng cuồng bạo dẫn ra, cũng cần thời gian, chờ hắn xác định, muốn động thủ thời điểm, lại ngăn cản cũng được!”"),t("br"),t("br"),n._v("Khoát tay áo, Hàn hội trưởng trí cuốn nắm chắc."),t("br"),t("br"),n._v("“Nha... Là học sinh lỗ mãng!”"),t("br"),t("br"),n._v("Nghe nói như thế, Lưu Mặc thở phào nhẹ nhõm."),t("br"),t("br"),n._v("Cũng đúng, tìm tiết điểm cần thời gian, tìm tới về sau, cho dù muốn dẫn nổ, cũng cần thời gian, tất cả mọi người là nhân vật có mặt mũi, không cần thiết hiện tại trở mặt."),t("br"),t("br"),n._v("Chỉ cần phát hiện hắn tìm tới tiết điểm, muốn nhen lửa thời điểm, ngăn cản là có thể."),t("br"),t("br"),n._v("“Ừm, cái này Trương viện trưởng, ta nghe nói qua không ít chuyện dấu vết, đối với trận pháp một đạo vô cùng có thiên phú, xem như một nhân tài! Bất quá, vẫn là tuổi còn rất trẻ, quá lỗ mãng, bất quá... Người trẻ tuổi liền muốn nhiều vấp phải trắc trở, mới biết được thế giới bao lớn, trận pháp thâm ảo, không phải chỉ biết điểm một cái da lông, liền có thể tùy ý vọng ngữ!”"),t("br"),t("br"),n._v("Hàn hội trưởng cười cười: “Trước hết để cho hắn tìm một cái thử xem, nhìn hắn dùng phương pháp gì, một khi tìm không thấy, tự nhiên là hiểu ý biết đến sự dốt nát của mình...”"),t("br"),t("br"),n._v("“Vâng!”"),t("br"),t("br"),n._v("Tràn đầy bội phục nhìn về phía lão sư, Lưu Mặc ánh mắt bên trong đều là sùng bái."),t("br"),t("br"),n._v("Thấy không, đây mới thật sự là đại tông sư, rõ ràng bị đối phương oán giận, hoàn hư hoài như cốc, vì đó suy nghĩ, để cho người ta phục sát đất."),t("br"),t("br"),n._v("Không để ý tới hai người trò chuyện, Trương Huyền lúc này đi tới phong ấn trước mặt cẩn thận nhìn về phía trước."),t("br"),t("br"),n._v("Đen nhánh trong con ngươi, hoa văn nhúc nhích, hình thành một đạo phong ba phong ba vầng sáng."),t("br"),t("br"),n._v("“Không được, ánh mắt của ta cùng kiến thức thực sự quá ít, trận pháp này quá mức huyền ảo, hoàn toàn xem không hiểu...”"),t("br"),t("br"),n._v("Lần nữa lắc đầu."),t("br"),t("br"),n._v("Đổi lại cái khác trận pháp, liền xem như thất tinh đỉnh phong, nhờ vào Minh Lý Chi Nhãn cùng hắn đối với trận pháp lĩnh ngộ, chỉ cần cho đầy đủ là đầy đủ thời gian, đều có thể tìm tới thiếu hụt, tìm ra mấu chốt."),t("br"),t("br"),n._v("Mà trước mắt cái này, lại là căn bản không có đầu mối."),t("br"),t("br"),n._v("“Xem ra chỉ có thể sử dụng Thiên Đạo thư viện...”"),t("br"),t("br"),n._v("Trong lòng than thở một tiếng, ngay sau đó mày nhăn lại: “Chỉ là, dùng thư viện, liền muốn dẫn động trận pháp, bảo trận pháp vận chuyển lại! Không vận chuyển lời nói, là không cách nào điều tra thiếu hụt...”"),t("br"),t("br"),n._v("Ngón tay nắm mi tâm."),t("br"),t("br"),n._v("Thiên Đạo thư viện, cũng không phải có thể tùy ý sử dụng, mà là cần riêng biệt thời cơ, thật giống như kiểm tra tu luyện giả, cần đối phương vận chuyển chân khí, thi triển võ kỹ!"),t("br"),t("br"),n._v("Trận pháp cũng giống vậy, nhất định phải vận chuyển mới được."),t("br"),t("br"),n._v("Cái này phong ấn, mặc dù bao phủ lại di tích lối vào, không ngừng chịu đến cổ quái lực lượng xung kích, trên thực tế lại không làm sao vận chuyển, cứ như vậy la lên thiếu hụt lời nói là không có bất kỳ cái gì hiệu quả."),t("br"),t("br"),n._v("Nên làm cái gì? Như thế nào mới có thể để hắn vận chuyển?"),t("br"),t("br"),n._v("Trương Huyền rơi vào trầm tư."),t("br"),t("br"),n._v("“Hắn thế mà không dùng la bàn? Cũng không có nhìn địa hình, địa thế... Cái tên này đến cùng biết hay không trận pháp?”"),t("br"),t("br"),n._v("Cách đó không xa Lưu Mặc, vốn định nhìn một chút vị này phách lối không ngớt Trương viện trưởng, đến cùng như thế nào tìm kiếm tiết điểm, chỉ thấy hắn đứng tại trống rỗng trước mặt, một mặt mờ mịt nhìn một hồi, tiếp lấy liền vò mi tâm..."),t("br"),t("br"),n._v("Liền la bàn đều không có lấy ra, càng liền chung quanh địa hình nhìn cũng không nhìn một cái..."),t("br"),t("br"),n._v("Còn có như vậy nghiên cứu trận pháp?"),t("br"),t("br"),n._v("“Có thể là đặc biệt phương pháp đi...”"),t("br"),t("br"),n._v("Hàn hội trưởng cũng có chút kỳ quái, tràn đầy không hiểu."),t("br"),t("br"),n._v("“Chỉ mong đúng thế... Hắn, hắn muốn làm gì?”"),t("br"),t("br"),n._v("Gật gật đầu, Lưu Mặc đáp một tiếng, đang muốn nói cái gì, lập tức thấy được cái này Trương viện trưởng động tác, giật nảy mình, suýt chút nữa không có tại chỗ ngất đi."),t("br"),t("br"),n._v("Chỉ thấy cái tên này chần chờ một chút, nâng lên một cái cực lớn tảng đá, trực tiếp hướng cái hố, ném tới."),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1024"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1026"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);